import React from "react";

//material-ui
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";

export const Main = () => {
  return (
    <div className="main">
      <React.Fragment>
        <Container
          justify='center'
          maxWidth="md"
          style={{ backgroundColor: "lightgrey", height: "100vh" }}
        >
          <Grid container >
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "red" }}
              md={6}
            ></Grid>
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "green" }}
              md={6}
            ></Grid>
          </Grid>
          <Grid container >
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "grey" }}
              md={6}
            ></Grid>
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "blue" }}
              md={6}
            ></Grid>
          </Grid>
        </Container>
      </React.Fragment>
    </div>
  );
};
